Lately I was dealing with an [SO question about precedence](https://stackoverflow.com/q/64593940/1082681). When reviewing the [corresponding AspectJ manual section](http://www.eclipse.org/aspectj/doc/next/progguide/semantics-advice.html#d0e6257) in order to improve my [extensive answer](https://stackoverflow.com/a/40071281/1082681) (please read) to [this older SO question](https://stackoverflow.com/q/39978586/108268), I noticed once more that understanding and explaining the consequences of intra-aspect precedence rules is quite difficult, even though describing those rules is quite simple. As a matter of fact, when looking at a relatively simple aspect with several types of aspects, it is by no means trivial to predict what is going to happen and, when intuitive or "naive" expectations are not met, to understand why that is so. This is especially the case if around advices als modify method arguments and/or return values.

Just look at this simple application:

```java
package de.scrum_master.app;

public class Application {
  public int doSomething(int i) {
    System.out.println("Doing something with " + i + ", returning " + (i - 10));
    return i - 10;
  }

  public static void main(String[] arg) {
    Application application = new Application();
    System.out.println(application.doSomething(99));
  }
}
```

Then there is a relatively simple aspect:

```java
package de.scrum_master.aspect;

import de.scrum_master.app.Application;

public aspect IntraAspectPrecedence {

  pointcut methodCall(int i) :
    call(int Application.doSomething(int)) && args(i);

  after(int i) returning (int result): methodCall(i) {
    System.out.println("after1 -> " + i + ", result = " + result);
  }

  int around(int i): methodCall(i) {
    System.out.println("around1 (pre-proceed) -> " + i);
    int result = proceed(11) * 5;
    System.out.println("around1 (post-proceed) -> " + i + ", result = " + result);
    return result;
  }

  int around(int i): methodCall(i) {
    System.out.println("around2 (pre-proceed) -> " + i);
    int result = proceed(22) / 2;
    System.out.println("around2 (post-proceed) -> " + i + ", result = " + result);
    return result;
  }

  before(int i): methodCall(i) {
    System.out.println("before1 -> " + i);
  }

  before(int i): methodCall(i) {
    System.out.println("before2 -> " + i);
  }

  after(int i) returning (int result): methodCall(i) {
    System.out.println("after2 -> " + i + ", result = " + result);
  }

}
```

The console log is:

```text
