```

This operation is allowed in property [ListIterator_RemoveOnce](https://runtimeverification.com/monitor/annotated-java/__properties/html/java/util/ListIterator_RemoveOnce.html), but as ListIterator is a subclass of Iterator, it is still considered illegal by Iterator_RemoveOnce. We suggest to have Iterator_RemoveOnce property to exclude ListIterator, as there is already a good property specifically for it.

We have seen large amount of violations for {Boolean, Byte, Character, Double, Float, Long, Integer, Short}_StaticFactory properties during runtime monitoring.
However, we don't feel these properties very useful in monitoring most appplication programs. 
Though it is stated in [Java API ](http://docs.oracle.com/javase/6/docs/api/java/lang/Integer.html#valueOf%28int%29)that using StaticFactory) "is likely to yield significantly better space and time performance by caching frequently requested values.", we think that 1) these performance bugs are less concerned for common developers than functional bugs and 2) according to our experiment, using static factory seems not render better space and time performance.
Following is the snippet we used for experiment:

``` Java
import java.util.Random;
public class TestStaticFactory {`
    public static void main(String[] args) {
        long startTime = System.nanoTime();
        int[] arr = new int[100];
        Random r = new Random();
        for(int i = 0; i < 1000000000; i++) {
            int num = r.nextInt(100);
            Integer result = nonStaticFactory(num);
        }
        long elapseTime = System.nanoTime() - startTime;
        System.out.println(Runtime.getRuntime().maxMemory());
        Runtime.getRuntime().gc();
        System.out.println("static " + elapseTime);
        startTime = System.nanoTime();
        r = new Random();
        for(int i = 0; i < 1000000000; i++) {
            int num = r.nextInt(100);
            Integer result = staticFactory(num);
        }
        elapseTime = System.nanoTime() - startTime;
        System.out.println(Runtime.getRuntime().maxMemory());
        System.out.println("non-static " + elapseTime);
    }
    private static Integer nonStaticFactory(int num) {
        return new Integer(num);
    }
    private static Integer staticFactory(int num) {
        return Integer.valueOf(num);
    }
}
```

With int within 1000 being processed 1 billion times, the caching effects of static factory should be significant.
However, the difference in time consumption of static factory and non-static factory methods were all within %10 running many times, and neither of them always out-wins another. The maximum memory usage of these methods were the same.
The result is similar if change the code to call non-static factory method before static factory method.
In all, though these properties might be useful for high-performance computing, we do not think these properties provide more benefits to common developers than the noise they introduce.

