Hi, can you please explain the practical value of monitoring the Map_UnsafeIterator property, as defined [here](http://fsl.cs.illinois.edu/annotated-java/__properties/html/java/util/Map_UnsafeIterator.html)? It seems that it will only generate false alarms, and any actual violation will already be caught by the JVM. This property should either be strengthened or removed completely. Here's some perfectly valid usage scenario in which JavaMOP will generate false alarms:

``` Java
import java.util.Map;
import java.util.HashMap;

public class Test104 {
  public static void main(String[] args) {
    Map<String, String> map = new HashMap<String, String>();
    map.put("1", "1"); map.put("2", "2"); map.put("3", "3");
    for(String key : map.keySet()) {
      String value = map.get(key);
      map.put(key, value + "1");
    }

    for(String key : map.keySet()) {
      System.out.println(map.get(key));
    }
  }
}
```

This works perfectly fine, `map` is not being "modified" in the sense that the number of elements is being changed but it's values are being updated. Here's a slight modification which modifies the map while iterating over it, but the JVM throws a ConcurrentModificationException:

``` Java
import java.util.Map;
import java.util.HashMap;

public class Test104 {
  public static void main(String[] args) {
    Map<String, String> map = new HashMap<String, String>();
    map.put("1", "1"); map.put("2", "2"); map.put("3", "3");
    for(String key : map.keySet()) {
      String value = map.get(key);
      map.put(key, value + "1");
      map.put(key + key, value + value);
    }

    for(String key : map.keySet()) {
      System.out.println(map.get(key));
    }
  }
}
```

Given the above, why should this property be dynamically monitored?

